import React from "react";
import { Container } from "react-bootstrap";

export default function Delivery() {
  return (
    <div className="Delivery-main">
      <div className="headline"></div>
      <Container>
        
      <div className="Buttons">
      <button type="button" className="btn btn-outline-secondary Buttons1">
      <img src="equ.svg" alt="equ" className="equ"/> Filters</button>
      <button type="button" className="btn btn-outline-secondary Buttons1">Rating: 4.0+</button>
      <button type="button" className="btn btn-outline-secondary Buttons1">Safe and Hygenic</button>
      <button type="button" className="btn btn-outline-secondary Buttons1">Pure Veg</button>
      <button type="button" className="btn btn-outline-secondary Buttons1">Delivery Time</button>
      <button type="button" className="btn btn-outline-secondary Buttons1">Great</button>
      
      </div>
      </Container>
    </div>
  );
}
